// src/App.js

import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link, Navigate } from 'react-router-dom';
import Country from './components/Country';
import State from './components/State';
import City from './components/City';
import UserPage from './components/UserPage';
import LoginPage from './components/LoginPage';

const App = () => {
  const [authenticatedUser, setAuthenticatedUser] = useState(null);

  const ProtectedRoute = ({ children, role }) => {
    if (!authenticatedUser) {
      return <Navigate to="/" />;
    }
    if (role && authenticatedUser.role !== role) {
      return <Navigate to="/unauthorized" />;
    }
    return children;
  };

  return (
    <Router>
      <div className="App">
        <h1>Country State City Management</h1>
        {!authenticatedUser ? (
          <Routes>
            <Route path="/" element={<LoginPage setAuthenticatedUser={setAuthenticatedUser} />} />
          </Routes>
        ) : (
          <>
            <nav>
              <Link to="/countries">Countries</Link>
              <Link to="/states">States</Link>
              <Link to="/cities">Cities</Link>
              <Link to="/user">User Page</Link>
              {authenticatedUser.role === 'admin' && <Link to="/admin">Admin Page</Link>}
            </nav>
            <Routes>
              <Route path="/" element={<Navigate to="/countries" />} />
              <Route path="/countries" element={<ProtectedRoute role="admin"><Country /></ProtectedRoute>} />
              <Route path="/states" element={<ProtectedRoute role="admin"><State /></ProtectedRoute>} />
              <Route path="/cities" element={<ProtectedRoute role="admin"><City /></ProtectedRoute>} />
              <Route path="/user" element={<ProtectedRoute role="user"><UserPage /></ProtectedRoute>} />
              <Route path="/admin" element={<ProtectedRoute role="admin"><AdminPage /></ProtectedRoute>} />
              <Route path="/unauthorized" element={<div>You are not authorized to view this page.</div>} />
            </Routes>
          </>
        )}
      </div>
    </Router>
  );
};

const AdminPage = () => (
  <div>
    <h2>Admin Page</h2>
    <p>Welcome, Admin!</p>
    {/* Admin functionalities like Add, Edit, Delete go here */}
  </div>
);

export default App;
